[{"location":"#ModelManagerStudio","page":"Home","title":"ModelManagerStudio","text":"Documentation for ModelManagerStudio.\n\n","category":"section"},{"location":"#ModelManagerStudio.get_pcmm_paths-Tuple{Vararg{AbstractString}}","page":"Home","title":"ModelManagerStudio.get_pcmm_paths","text":"get_pcmm_paths(args::Vararg{AbstractString})\n\nGet the PhysiCell and data directories from the provided arguments. See launch for details on how the arguments are interpreted.\n\n\n\n\n\n","category":"method"},{"location":"#ModelManagerStudio.init_model_manager_gui-Tuple{Vararg{AbstractString}}","page":"Home","title":"ModelManagerStudio.init_model_manager_gui","text":"init_model_manager_gui(args::Vararg{AbstractString}; kwargs...)\n\nInternal function to initialize the Model Manager GUI with the specified arguments. Called by launch.\n\n\n\n\n\n","category":"method"},{"location":"#ModelManagerStudio.launch-Tuple","page":"Home","title":"ModelManagerStudio.launch","text":"launch()\nlaunch(path_to_project::AbstractString)\nlaunch(physicell_dir::AbstractString, data_dir::AbstractString)\n\nLaunch the Model Manager Studio GUI for a particular project.\n\nIf no arguments are provided, it will initialize the Model Manager within the current working directory, i.e., using data_dir = \"./data\" and physicell_dir = \"./PhysiCell\". If a single argument is provided, it will use that as the base directory and append data and PhysiCell to it, i.e., data_dir = \"$(path_to_project)/data\" and physicell_dir = \"$(path_to_project)/PhysiCell\". If two arguments are provided, they will be used as the physicell_dir and data_dir, respectively.\n\nExamples\n\nusing ModelManagerStudio\nlaunch()  # Launches with default paths in the current directory, i.e., `data_dir = \"./data\"` and `physicell_dir = \"./PhysiCell\"`\nlaunch(\"path/to/project\")  # Launches with specified project path (will ask if paths differ)\nlaunch(\"path/to/PhysiCell\", \"path/to/data\")  # Launches with specified PhysiCell and data directories\n\n\n\n\n\n","category":"method"},{"location":"#ModelManagerStudio.main-Tuple{Any}","page":"Home","title":"ModelManagerStudio.main","text":"main(args)\n\nEntry point for ModelManagerStudio application. Calls launch to start the application. See launch for argument details.\n\n\n\n\n\n","category":"method"},{"location":"#ModelManagerStudio.studio_initialize_model_manager-Tuple{Vararg{AbstractString}}","page":"Home","title":"ModelManagerStudio.studio_initialize_model_manager","text":"studio_initialize_model_manager(args::Vararg{AbstractString})\n\nInternal function to initialize the Model Manager with the specified arguments. Called by init_model_manager_gui.\n\n\n\n\n\n","category":"method"}]
